from flask import Flask
from flask_restplus import Api, Resource, fields
from werkzeug.contrib.fixers import ProxyFix

app = Flask(__name__)
app.wsgi_app = ProxyFix(app.wsgi_app)
api = Api(app, 
          version='1.0', 
          title='Get Country Details', 
          description='A simple Country Details API', 
          prefix="/v1",
          contact="john@swarmee.net",
          contact_url="www.swarmee.net"
          )

ns = api.namespace('country', 
                   description='Country API operations')

country = api.model('country', 
          {'id'         : fields.Integer(readOnly=True, description='The country unique identifier'),
           'countryName': fields.String (readOnly=True, description='Country Code'),
           'postcode': fields.String (required=True, description='The country name'),
           'stateName' : fields.String (required=False, description='The country geo lat'),
           'stateCode': fields.String (required=False, description='The country geo long'),           
           'stateCapital': fields.String (required=False, description='The country geo long'),
           'lat': fields.Float (required=False, description='The country geo long'),
           'long': fields.Float (required=False, description='The country geo long')
                        }
                 )

class countryDAO(object):
    def __init__(self):
        self.counter = 0
        self.countrys = []

    def get(self, id):
        for country in self.countrys:
            if country['id'] == id:
                return country
        api.abort(404, "Country {} doesn't exist".format(id))

    def get(self, postcode):
        for country in self.countrys:
            if country['postcode'] == postcode:
                return country
        api.abort(404, "Country {} doesn't exist".format(postcode))

    def create(self, data):
        country = data
        country['id'] = self.counter = self.counter + 1
        self.countrys.append(country)
        return country

