@ns.route('/')
class countryList(Resource):
    '''Shows a list of all countrys'''

    @ns.marshal_list_with(country)
    def get(self):
        '''List all countrys'''
        return DAO.countrys

@ns.route('/<int:id>')
@ns.response(404, 'Country not found')
@ns.param('id', 'The country id')
class Country(Resource):
    '''Show a single country based on record id'''
    @ns.marshal_with(country)
    def get(self, id):
        '''Fetch a given resource'''
        return DAO.get(id)

@ns.route('/<string:postcode>')
@ns.response(404, 'Country not found')
@ns.param('postcode', 'The country identifier')
class Country(Resource):
    '''Show a single country based on postcode'''
    @ns.marshal_with(country)
    def get(self, postcode):
        '''Fetch a given resource'''
        return DAO.get(postcode)

